DROP TABLE IF EXISTS content;

CREATE TABLE `content` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user` enum('all','op','s') NOT NULL DEFAULT 'all',
  `title` varchar(250) DEFAULT NULL,
