) ENGINE=MyISAM DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS payment;

CREATE TABLE `payment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `survey_id` int(11) DEFAULT NULL,
  `operator_id` int(11) NOT NULL,
  `surveyor_id` int(11) NOT NULL,
  `invoice_amount` decimal(15,2) DEFAULT NULL,
  `transfer_cost_operator` decimal(15,2) NOT NULL,
  `received_from_operator` decimal(15,2) DEFAULT NULL,
  `invoice_status` enum('unpaid','paid') NOT NULL DEFAULT 'unpaid',
  `paid_to_surveyor_status` enum('unpaid','paid') NOT NULL DEFAULT 'unpaid',
  `transfer_to_surveyor` decimal(15,2) NOT NULL,
  `balance_for_this_surveyor` decimal(15,2) NOT NULL,
  `commission_amount` decimal(15,2) NOT NULL,
  `imars_transfer_cost` decimal(15,2) DEFAULT NULL,
  `invoice` varchar(255) NOT NULL,
  `request` enum('0','1') NOT NULL DEFAULT '0',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS payment_request;

CREATE TABLE `payment_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `surveyor_id` int(11) DEFAULT NULL,
  `country_id` int(11) NOT NULL,
  `invoice_total` decimal(15,2) NOT NULL,
  `survey_ids` varchar(255) DEFAULT NULL,
  `surveyor_balance` decimal(15,2) NOT NULL,
  `payment_method` varchar(30) NOT NULL,
  `actual_transferto_surveyor` decimal(15,2) NOT NULL,
  `early_withdrawal_fees` decimal(15,2) NOT NULL,
  `imars_transfer_cost` decimal(15,2) NOT NULL,
  `total_commission` decimal(15,2) NOT NULL,
  `status` enum('unpaid','paid') NOT NULL DEFAULT 'unpaid',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS port;

CREATE TABLE `port` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `country_id` int(11) DEFAULT NULL,
  `country` varchar(255) NOT NULL,
  `country_code` varchar(30) NOT NULL,
  `port` varchar(255) NOT NULL,
  `status` enum('0','1') NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5012 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS rating;

CREATE TABLE `rating` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
