  `rating` decimal(2,1) NOT NULL,
  `comment` text NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS survey;

CREATE TABLE `survey` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `country_id` int(11) NOT NULL,
  `port_id` int(11) DEFAULT NULL,
  `survey_number` varchar(255) DEFAULT NULL,
  `ship_id` int(11) DEFAULT NULL,
  `start_date` varchar(255) DEFAULT NULL,
  `end_date` varchar(255) DEFAULT NULL,
  `survey_type_id` int(11) DEFAULT NULL,
  `surveyors_id` varchar(255) DEFAULT NULL,
  `instruction` text,
  `file_data` varchar(255) DEFAULT NULL,
  `agent_id` int(11) DEFAULT NULL,
  `status` enum('0','1','2','3','4','5','6','7') NOT NULL DEFAULT '0' COMMENT '0 for pending,1 for upcoming,2 for cancelled,3 for report submitted ,4 for report accepted, 5 for invoice paid,6 surveyor paid',
  `last_status` tinyint(2) DEFAULT '0',
  `report` varchar(255) NOT NULL,
  `invoice` varchar(255) NOT NULL,
  `accept_by` int(11) NOT NULL,
  `assign_to` int(11) NOT NULL,
  `assign_to_op` int(11) NOT NULL,
  `declined` enum('0','1') NOT NULL DEFAULT '0',
  `active_thread` int(11) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS survey_type;

CREATE TABLE `survey_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `code` varchar(50) NOT NULL,
  `price` varchar(255) DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1',
