  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `accept_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=83 DEFAULT CHARSET=latin1;



