INSERT INTO email_templates VALUES("1","User Registration","Welcome to iMarS","user-registration","<p>Hello USER_NAME,</p>\n\n<p>Thank you signing up and being part of iMarS community. Please verify your email by clicking the link below:</p>\n\n<p>EMAIL_VERIFY_LINK</p>\n\n<p>Next, please log in to your account and go to Account - My Profile menu and:</p>\n\n<p>1) Verify your phone number<br />\n2) Hit edit profile button on the top right corner and enter your address details<br />\n3) Upload required ID and documents for account verification<br />\n4) Once finished, click - Submit - button to activate your account.</p>\n\n<p>Information you provided will be reviewed and your account will be activated within 24 hours.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2019-07-18 16:07:45","2020-06-01 22:55:11");
INSERT INTO email_templates VALUES("2","User Forgot Password","Complete your password reset request!","user-forgot-password","<p>Dear {USER_NAME},</p>\n\n<p>Please follow the link below to reset your password so you can get back to using your MarS account.</p>\n\n<p>{FORGOT_PASSWORD_LINK}</p>\n\n<p>If you did not ask to reset your password, please contact iMarS at imars@marineinfotech.com for suspicous account activity.&nbsp;</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2019-07-18 16:13:16","2020-06-02 02:07:49");
INSERT INTO email_templates VALUES("3","Complete Order Thank You","Order completed, thank you!","complete-order-thank-you","<p>Hi {USERNAME},</p>\n\n<p>Thank you for your purchase!</p>\n\n<p>Thanks,</p>\n\n<p>iMarS Team</p>","2019-07-18 16:14:30","2020-06-02 01:58:05");
INSERT INTO email_templates VALUES("4","operator add by dp","Welcome to iMarS!","operator-add-by-dp","<p>Hello,</p>\n\n<p>You have been added as an operator of COMPANY_NAME to iMarS by DP_NAME .</p>\n\n<p>Please use the link below to sign up.</p>\n\n<p>SIGNUP_LINK</p>\n\n<p>After you sign up, you can log in to iMarS, verify your phone number, and see survey details and manage your surveys.</p>\n\n<p>Welcome to iMarS community!</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 10:45:03","2020-06-02 01:56:36");
INSERT INTO email_templates VALUES("5","Surveyor Add By DP","Welcome to iMarS!","surveyor-add-by-dp","<p>Hello,</p>\n\n<p>You have been added as a surveyor of COMPANY_NAME to iMarS by DP_NAME. Please use the link below to sign up.</p>\n\n<p>SIGNUP_LINK</p>\n\n<p>After you sign up, you can log in to iMarS, verify your phone number, and see survey details and manage your calendar.</p>\n\n<p>Welcome to iMarS community!</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 10:50:37","2020-06-02 01:56:22");
INSERT INTO email_templates VALUES("6","signup operator of operator company","Welcome to iMarS!","signup-operator-of-operator-company","<p>Hello USER_NAME</p>\n\n<p>Thank you signing up and being part of iMarS community. Please verify your email by clicking the link below:</p>\n\n<p>EMAIL_VERIFY_LINK</p>\n\n<p>You can now log in to your account, and verify your phone number.</p>\n\n<p>Once your account is verified, you will have full access to the full menus of iMarS.</p>\n\n<p>Sincerely,</p>\n\n<p>iMarS Team</p>","2020-05-29 10:53:42","2020-06-02 01:56:01");
INSERT INTO email_templates VALUES("7","signup surveyor of surveyor company","Welcome to iMarS!","signup-surveyor-of-surveyor-company","<p><br />\nHello USER_NAME,</p>\n\n<p>Thank you signing up and being part of iMarS community.</p>\n\n<p>You can now log in to your account, and verify your phone number.</p>\n\n<p>Once your phone number is verified, you will have full access to menus of iMarS.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 10:59:58","2020-06-02 01:52:34");
INSERT INTO email_templates VALUES("8","Appoint Survey","New survey request received!","appoint-survey","<p>Hello USER_NAME,</p>\n\n<p>You have received a new survey request. Please accept the survey request within 8 hours, or the request will be either cancelled or sent to another surveyor.</p>\n\n<p>Accepting new requests will increase your job acceptance rate and your chance to be appointed for future surveys.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:12:10","2020-06-02 01:45:40");
INSERT INTO email_templates VALUES("9","Decline Survey","Your survey request has been declined!","decline-survey","<p>Hello USER_NAME,</p>\n\n<p>One of the surveyors you selected for the survey has declined the request. If all your selected surveyors decline the request, the survey will be listed in Cancelled surveys tab.</p>\n\n<p>If one of the surveyors you selected accept the survey request, you will be notified with another email and the survey will be listed in your Upcoming surveys tab.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:14:52","2020-06-02 01:50:15");
INSERT INTO email_templates VALUES("10","Accept   Survey","Your survey request has been accepted!","accept-survey","<p>Hello USER_NAME,</p>\n\n<p>Your survey request has been accepted by the surveyor you selected. The survey is now listed in your Upcoming surveys tab.</p>\n\n<p>You can log in and use the chat window to message the surveyor if needed.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:17:30","2020-06-02 01:50:01");
INSERT INTO email_templates VALUES("11","Chat Message","New chat message received!","chat-message","<p>Hello RECEIVER_NAME,</p>\n\n<p>You have received a new message from SENDER_NAME:<br />\n-------------------------------------------------------------<br />\nMESSAGE_CONTENT<br />\n--------------------------------------------------------------</p>\n\n<p>You can log in and respond to this message in the chat window.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:21:08","2020-06-02 02:24:53");
INSERT INTO email_templates VALUES("12","Assign Survey  to Surveyor","You are assigned a new survey!","assign-survey-to-surveyor","<p>Hello USER_NAME,</p>\n\n<p>The Designated Person of your company has assigned you a new survey #SURVEY_NUMBER</p>\n\n<p>Please check your upcoming surveys and calendar to see the survey details.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:23:21","2020-06-02 01:52:03");
INSERT INTO email_templates VALUES("13","Assign Survey  to Operator","You are assigned a new survey!","assign-survey-to-operator","<p>Hello USER_NAME,</p>\n\n<p>The Designated Person of your company has assigned you a new survey #SURVEY_NUMBER</p>\n\n<p>Please check your upcoming surveys and calendar to see the survey details.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:25:16","2020-06-02 01:51:49");
INSERT INTO email_templates VALUES("14","Survey Report Submit","A new survey report received!","survey-report-submit","<p><br />\nHello USER_NAME,</p>\n\n<p>You have received a survey report. You can view and download the report in your account under Report Submitted surveys tab.</p>\n\n<p>Once you accept the report (or if you do not respond within 3 days), an automated invoice will be generated and emailed to you for due in 30 days.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:27:21","2020-06-02 01:51:35");
INSERT INTO email_templates VALUES("15","Survey Report Accept","Your report has been accepted!","survey-report-accept","<p>Hello USER_NAME,</p>\n\n<p>The report you have submitted has been accepted by the operator, and the invoice has been emailed to the operator due payment in 30 days.</p>\n\n<p>Once the operator transfers the funds to iMarS, your account balance will be updated to reflect the payment received from the operator.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:28:57","2020-06-02 02:53:10");
INSERT INTO email_templates VALUES("16","Survey Accept Invoice Send To Operator","New invoice received!","survey-accept-invoice-send-to-operator","<p>Hello USER_NAME,</p>\n\n<p>You have received a new invoice due payment in 30 days. Please see the attached invoice.</p>\n\n<p>LINK</p>\n\n<p>You can combine several invoices in one payment to iMarS - but for all wire transfers, please be sure to list all the invoice reference numbers that are included in the payment.</p>\n\n<p>Please make sure to pay the invoices by the due date for creating a positive experience for our community. For late payments, there may be penalties up to the deactivation of your account.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:33:27","2020-06-02 01:51:15");
INSERT INTO email_templates VALUES("17","Appoint Custom Survey","You have a new Custom Occasional Survey request!","appoint-custom-survey","<p>Hello USER_NAME,</p>\n\n<p>You have a new Custom Occasional Survey request. Please go into survey details and check the instructions document and submit a quote.</p>\n\n<p>If the operator accepts your quote among the quotes received from other surveyors (up to five surveyors maximum), you will be notified, and the survey will be listed in your Upcoming surveys tab.</p>\n\n<p>If you are not selected for the survey by the operator, the survey will be removed from your account. It is possible that the operator may select another surveyor for their price or rating. Thank you in advance for submitting your quote, and hope you will be selected for the job ?</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:36:55","2020-06-02 23:46:11");
INSERT INTO email_templates VALUES("18","Payment Send To Surveyor","Your payment is on its way!","payment-send-to-surveyor","<p>Hello USER_NAME,</p>\n\n<p>We have received your request for payment for surveys #SURVEY_NUMBER.</p>\n\n<p>The payment has been initiated with the method you selected.</p>\n\n<p>Please note that it may take up to several days for the funds to arrive based on the method you selected and the country you reside.</p>\n\n<p>Thank you again for being part of iMarS community.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:41:29","2020-05-29 11:41:29");
INSERT INTO email_templates VALUES("19","Payment Receive From Operator","Thank you for your payment!","payment-receive-from-operator","<p>Hello USER_NAME,</p>\n\n<p>We have received your payment for Survey# SURVEY_NUMBER.</p>\n\n<p>Thank you again for being part of iMarS community.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 11:43:44","2020-05-29 11:43:44");
INSERT INTO email_templates VALUES("20","survey submit bid","Received a quote for a Custom Occasional Survey!","survey-submit-bid","<p>Hello OPERATOR_NAME</p>\n\n<p>SURVEYOR_NAME has submitted a quote of $BID_AMOUNT for your Custom Occasional Survey #SURVEY_NUMBER</p>\n\n<p>Please log in and see the quotes submitted for your request.</p>\n\n<p>Sincerely,<br />\niMarS Team</p>","2020-05-29 13:40:29","2020-06-02 23:50:57");
